import * as React from 'react';
import {AppBar} from "@mui/material";



function NavBar() {
  

  return (
   
<AppBar sx={{
  position :"fixed",
  top:"1.5%",
    zIndex: "11",
    backgroundColor:"white",
    width:"85%",
    height:"3vw",
    borderRadius:"15px",
    right:"auto"
   }} id = "navbar"></AppBar>
   
  );
}
export default NavBar;
